    personalInfo: {
      fullName: "",
      email: "",
      phone: "",
    },
    education: [],
    experience: [],
    skills: [], 
  });

  return (
    <div className="App">
      <div className="App">
        <Header />
        <main>
          {/* Pass setFormData as a prop to Form component */}
          <Form formData={formData} setFormData={setFormData} />
          {/* Pass formData as a prop to CV component */}
          <CV formData={formData} setFormData={setFormData} />
        </main>
        <Footer />
      </div>
    </div>
  );
}

export default App;
